iew reflects the text in the upper text editing area as it will appear if you choose to save.\";'),('en','messages:session_fail_preview','s:179:\"\'\'\'Sorry! We could not process your edit due to a loss of session data.\'\'\'\nPlease try again.\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in.\";'),('en','messages:session_fail_preview_html','s:338:\"\'\'\'Sorry! We could not process your edit due to a loss of session data.\'\'\'\n\n\'\'Because {{SITENAME}} has raw HTML enabled, the preview is hidden as a precaution against JavaScript attacks.\'\'\n\n\'\'\'If this is a legitimate edit attempt, please try again.\'\'\'\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in.\";'),('en','messages:token_suffix_mismatch','s:259:\"\'\'\'Your edit has been rejected because your client mangled the punctuation characters in the edit token.\'\'\'\nThe edit has been rejected to prevent corruption of the page text.\nThis sometimes happens when you are using a buggy web-based anonymous proxy service.\";'),('en','messages:edit_form_incomplete','s:114:\"\'\'\'Some parts of the edit form did not reach the server; double-check that your edits are intact and try again.\'\'\'\";'),('en','messages:editing','s:10:\"Editing $1\";'),('en','messages:creating','s:11:\"Creating $1\";'),('en','messages:editingsection','s:20:\"Editing $1 (section)\";'),('en','messages:editingcomment','s:24:\"Editing $1 (new section)\";'),('en','messages:editconflict','s:17:\"Edit conflict: $1\";'),('en','messages:explainconflict','s:333:\"Someone else has changed this page since you started editing it.\nThe upper text area contains the page text as it currently exists.\nYour changes are shown in the lower text area.\nYou will have to merge your changes into the existing text.\n\'\'\'Only\'\'\' the text in the upper text area will be saved when you press \"{{int:savearticle}}\".\";'),('en','messages:yourtext','s:9:\"Your text\";'),('en','messa